--
-- Definition of procedure `DOCUMENTE_SCANATEsp_select`
--

DROP PROCEDURE IF EXISTS `DOCUMENTE_SCANATEsp_select`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `DOCUMENTE_SCANATEsp_select`(
        _AUTHENTICATED_USER_ID INT,
        _SORT VARCHAR(100),
        _ORDER VARCHAR(5),
        _FILTER VARCHAR(4000),
        _LIMIT VARCHAR(100)
    )
BEGIN
        DECLARE _DEFAULT_FILTER VARCHAR(2000);

        DECLARE _QUERY VARCHAR(8000);
        /*
        SET @_DEFAULT_FILTER = CONCAT('(', _AUTHENTICATED_USER_ID, ' IN (SELECT ID FROM UTILIZATORI WHERE ID_TIP_UTILIZATOR = (SELECT ID FROM TIP_UTILIZATORI WHERE UPPER(DENUMIRE)=''ADMINISTRATOR'')) OR ');
        SET @_DEFAULT_FILTER = CONCAT(@_DEFAULT_FILTER, '( ', _AUTHENTICATED_USER_ID, ' IN (SELECT ID FROM UTILIZATORI WHERE ID_TIP_UTILIZATOR = (SELECT ID FROM TIP_UTILIZATORI WHERE UPPER(DENUMIRE) LIKE ''%SUPER%''))
                AND (U.ID IN (SELECT ID_UTILIZATOR FROM UTILIZATORI_SOCIETATI WHERE ID_SOCIETATE IN (SELECT ID_SOCIETATE FROM UTILIZATORI_SOCIETATI WHERE ID_UTILIZATOR=', _AUTHENTICATED_USER_ID,') AND U.ID_TIP_UTILIZATOR = (SELECT ID FROM TIP_UTILIZATORI WHERE UPPER(DENUMIRE) LIKE ''%REGULAR%'') )) ))');
        */
        SET @_DEFAULT_FILTER = '1=1';

        IF _ORDER IS NULL AND _SORT IS NULL THEN
                 SET _SORT = ' DOCUMENTE_SCANATE.DENUMIRE_FISIER ';
        END IF;

        SET @_QUERY = 'SELECT DOCUMENTE_SCANATE.* ';

            SET @_QUERY = CONCAT(@_QUERY,
                'FROM DOCUMENTE_SCANATE '
                );

        CASE WHEN _FILTER IS NOT NULL THEN
                SET @_QUERY = CONCAT(@_QUERY, ' WHERE (', @_DEFAULT_FILTER, ') AND (', _FILTER, ') ');
        ELSE
                BEGIN
                 SET @_QUERY = CONCAT(@_QUERY, ' WHERE ', @_DEFAULT_FILTER, ' ');
                END;
        END CASE;

        CASE WHEN _SORT IS NOT NULL THEN
                BEGIN
                        SET @_QUERY = CONCAT(@_QUERY, ' ORDER BY ', _SORT);
                END;
        ELSE
                SET @_QUERY = @_QUERY;
        END CASE;

        CASE WHEN _ORDER IS NOT NULL THEN
                SET @_QUERY = CONCAT(@_QUERY, ' ', _ORDER);
        ELSE
                SET @_QUERY = @_QUERY; 
        END CASE;

        IF _LIMIT IS NOT NULL THEN
                SET @_QUERY = CONCAT(@_QUERY, _LIMIT, ';');
        END IF;

        -- select @_QUERY;

          PREPARE stmt1 FROM @_QUERY;
          EXECUTE stmt1;
          DEALLOCATE PREPARE stmt1;
          


END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

