DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `DOSAREsp_GetInvolvedParties`(
        _AUTHENTICATED_USER_ID INT,
        _ID_DOSAR INT)
BEGIN
        SELECT ID FROM UTILIZATORI WHERE ID_SOCIETATE IN (SELECT ID_SOCIETATE_CASCO FROM DOSARE WHERE ID = _ID_DOSAR) OR ID_SOCIETATE IN (SELECT ID_SOCIETATE_RCA FROM DOSARE WHERE ID = _ID_DOSAR)
        UNION
        -- pentru SCA:
        SELECT ID_UTILIZATOR ID FROM UTILIZATORI_DOSARE WHERE ID_DOSAR = _ID_DOSAR AND ID_UTILIZATOR NOT IN (SELECT ID FROM UTILIZATORI WHERE ID_SOCIETATE IN (SELECT ID_SOCIETATE_CASCO FROM DOSARE WHERE ID = _ID_DOSAR) OR ID_SOCIETATE IN (SELECT ID_SOCIETATE_RCA FROM DOSARE WHERE ID = _ID_DOSAR));
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

