--
-- Definition of procedure `DOSAREsp_select`
--

DROP PROCEDURE IF EXISTS `DOSAREsp_select`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `DOSAREsp_select`(
        _AUTHENTICATED_USER_ID INT,
        _SORT VARCHAR(100),
        _ORDER VARCHAR(5),
        _FILTER VARCHAR(8000),
        _LIMIT VARCHAR(1000)
    )
BEGIN
        DECLARE _DEFAULT_FILTER VARCHAR(2000);
        DECLARE _QUERY VARCHAR(8000);

        SET @_DEFAULT_FILTER = CONCAT('(', _AUTHENTICATED_USER_ID, ' IN (SELECT ID_UTILIZATOR FROM UTILIZATORI_DREPTURI WHERE ID_DREPT IN (SELECT ID FROM DREPTURI WHERE UPPER(DENUMIRE)=''VIZUALIZARE'')) OR ', _AUTHENTICATED_USER_ID, ' IN (SELECT ID_UTILIZATOR FROM UTILIZATORI_DREPTURI WHERE ID_DREPT IN (SELECT ID FROM DREPTURI WHERE UPPER(DENUMIRE)=''ADMINISTRARE''))) AND ');

        -- ADMINI
        SET @_DEFAULT_FILTER = CONCAT('(', _AUTHENTICATED_USER_ID, ' IN (SELECT ID FROM UTILIZATORI WHERE ID_TIP_UTILIZATOR = (SELECT ID FROM TIP_UTILIZATORI WHERE UPPER(DENUMIRE)=''ADMINISTRATOR'')) OR ');

        -- SUPER USERS
        SET @_DEFAULT_FILTER = CONCAT(@_DEFAULT_FILTER, '(', _AUTHENTICATED_USER_ID, ' IN (SELECT ID FROM UTILIZATORI WHERE ID_TIP_UTILIZATOR = (SELECT ID FROM TIP_UTILIZATORI WHERE UPPER(DENUMIRE) LIKE ''%SUPER%'')) AND
                (DOSARE.ID_SOCIETATE_CASCO IN (SELECT ID_SOCIETATE FROM UTILIZATORI WHERE ID=', _AUTHENTICATED_USER_ID, ') OR DOSARE.ID_SOCIETATE_RCA IN (SELECT ID_SOCIETATE FROM UTILIZATORI WHERE ID=', _AUTHENTICATED_USER_ID, ')) ) OR ');

        -- REGULAR USERS
        SET @_DEFAULT_FILTER = CONCAT(@_DEFAULT_FILTER, '(', _AUTHENTICATED_USER_ID, ' IN (SELECT ID FROM UTILIZATORI WHERE ID_TIP_UTILIZATOR = (SELECT ID FROM TIP_UTILIZATORI WHERE UPPER(DENUMIRE) LIKE ''%REGULAR%'')) AND
                ((DOSARE.ID_SOCIETATE_CASCO IN (SELECT ID_SOCIETATE FROM UTILIZATORI WHERE ID=', _AUTHENTICATED_USER_ID, ') AND DOSARE.ID_SOCIETATE_RCA IN (SELECT ID_SOCIETATE FROM UTILIZATORI_SOCIETATI_ADMINISTRATE WHERE ID_UTILIZATOR=', _AUTHENTICATED_USER_ID, ')) OR
                (DOSARE.ID_SOCIETATE_RCA IN (SELECT ID_SOCIETATE FROM UTILIZATORI WHERE ID=', _AUTHENTICATED_USER_ID, ') AND DOSARE.ID_SOCIETATE_CASCO IN (SELECT ID_SOCIETATE FROM UTILIZATORI_SOCIETATI_ADMINISTRATE WHERE ID_UTILIZATOR=', _AUTHENTICATED_USER_ID, ')) )) )');

        IF _ORDER IS NULL AND _SORT IS NULL THEN
                 SET _SORT = ' DOSARE.DATA_AVIZARE DESC ';
        END IF;
        /*
        SET @_QUERY = CONCAT('SELECT DOSARE.*, ',
                        'ASIGC.DENUMIRE ASIGURAT_CASCO, ',
                        'ASIGR.DENUMIRE ASIGURAT_RCA, ',
                        'AC.NR_AUTO NR_AUTO_CASCO, ',
                        'AR.NR_AUTO NR_AUTO_RCA, ',
                        'SC.DENUMIRE ASIGURATOR_CASCO, ',
                        'SR.DENUMIRE ASIGURATOR_RCA, ',
                        'I.DENUMIRE INTERVENIENT, ',
                        'TD.DENUMIRE TIP_DOSAR '
                      );
            */
        SET @_QUERY = 'SELECT DOSARE.* ';

            SET @_QUERY = CONCAT(@_QUERY,
                'FROM DOSARE ',
                -- 'INNER JOIN DOSARE_STADII DS ON D.ID=DS.ID_DOSAR ',
                -- 'INNER JOIN STADII S ON DS.ID_STADIU=S.ID ',
                'LEFT JOIN ASIGURATI ASIGC ON DOSARE.ID_ASIGURAT_CASCO=ASIGC.ID ',
                'LEFT JOIN ASIGURATI ASIGR ON DOSARE.ID_ASIGURAT_RCA=ASIGR.ID ',
                'LEFT JOIN AUTO AC ON DOSARE.ID_AUTO_CASCO=AC.ID ',
                'LEFT JOIN AUTO AR ON DOSARE.ID_AUTO_RCA=AR.ID ',
                'LEFT JOIN SOCIETATI_ASIGURARE SC ON DOSARE.ID_SOCIETATE_CASCO=SC.ID ',
                'LEFT JOIN SOCIETATI_ASIGURARE SR ON DOSARE.ID_SOCIETATE_RCA=SR.ID ',
                'LEFT JOIN INTERVENIENTI I ON DOSARE.ID_INTERVENIENT=I.ID ',
                'LEFT JOIN TIP_DOSARE TD ON DOSARE.ID_TIP_DOSAR=TD.ID '
                );

        CASE WHEN _FILTER IS NOT NULL THEN
                SET @_QUERY = CONCAT(@_QUERY, ' WHERE (', @_DEFAULT_FILTER, ') AND (', _FILTER, ') ');
        ELSE
                BEGIN
                 SET @_QUERY = CONCAT(@_QUERY, ' WHERE (', @_DEFAULT_FILTER, ') ');
                END;
        END CASE;

        CASE WHEN _SORT IS NOT NULL THEN
                BEGIN
                        CASE WHEN _SORT = 'ASIGURAT_CASCO' THEN
                                SET @_QUERY = CONCAT(@_QUERY, ' ORDER BY ASIGC.DENUMIRE');
                        WHEN _SORT = 'ASIGURAT_RCA' THEN
                                SET @_QUERY = CONCAT(@_QUERY, ' ORDER BY ASIGR.DENUMIRE');
                        WHEN _SORT = 'ASIGURATOR_CASCO' THEN
                                SET @_QUERY = CONCAT(@_QUERY, ' ORDER BY SC.DENUMIRE');
                        WHEN _SORT = 'ASIGURATOR_RCA' THEN
                                SET @_QUERY = CONCAT(@_QUERY, ' ORDER BY SR.DENUMIRE');
                        WHEN _SORT = 'INTERVENIENT' THEN
                                SET @_QUERY = CONCAT(@_QUERY, ' ORDER BY I.DENUMIRE');
                        WHEN _SORT = 'NR_AUTO_CASCO' THEN
                                SET @_QUERY = CONCAT(@_QUERY, ' ORDER BY AC.NR_AUTO');
                        WHEN _SORT = 'NR_AUTO_RCA' THEN
                                SET @_QUERY = CONCAT(@_QUERY, ' ORDER BY AR.NR_AUTO');
                        WHEN _SORT = 'TIP_DOSAR' THEN
                                SET @_QUERY = CONCAT(@_QUERY, ' ORDER BY TD.DENUMIRE');
                        ELSE
                                SET @_QUERY = CONCAT(@_QUERY, ' ORDER BY ', _SORT);
                        END CASE;
                END;
        ELSE
                SET @_QUERY = @_QUERY;
        END CASE;

        CASE WHEN _ORDER IS NOT NULL THEN
                SET @_QUERY = CONCAT(@_QUERY, ' ', _ORDER);
        ELSE
                SET @_QUERY = @_QUERY; 
        END CASE;

        IF _LIMIT IS NOT NULL THEN
                SET @_QUERY = CONCAT(@_QUERY, _LIMIT, ';');
        END IF;

        -- select @_QUERY;

          PREPARE stmt1 FROM @_QUERY;
          EXECUTE stmt1;
          DEALLOCATE PREPARE stmt1;
         
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

