        -- SUPER USERS
        SET @_DEFAULT_FILTER = CONCAT(@_DEFAULT_FILTER, '(', _AUTHENTICATED_USER_ID, ' IN (SELECT ID FROM UTILIZATORI WHERE ID_TIP_UTILIZATOR = (SELECT ID FROM TIP_UTILIZATORI WHERE UPPER(DENUMIRE) LIKE ''%SUPER%'')) AND
                (DOSARE.ID_SOCIETATE_CASCO IN (SELECT ID_SOCIETATE FROM UTILIZATORI_SOCIETATI WHERE ID_UTILIZATOR=', _AUTHENTICATED_USER_ID, ') OR DOSARE.ID_SOCIETATE_RCA IN (SELECT ID_SOCIETATE FROM UTILIZATORI_SOCIETATI WHERE ID_UTILIZATOR=', _AUTHENTICATED_USER_ID, ')) ) OR ');

        -- REGULAR USERS
        SET @_DEFAULT_FILTER = CONCAT(@_DEFAULT_FILTER, '(', _AUTHENTICATED_USER_ID, ' IN (SELECT ID FROM UTILIZATORI WHERE ID_TIP_UTILIZATOR = (SELECT ID FROM TIP_UTILIZATORI WHERE UPPER(DENUMIRE) LIKE ''%REGULAR%'')) AND
                ((DOSARE.ID_SOCIETATE_CASCO IN (SELECT ID_SOCIETATE FROM UTILIZATORI_SOCIETATI WHERE ID_UTILIZATOR=', _AUTHENTICATED_USER_ID, ') AND DOSARE.ID_SOCIETATE_RCA IN (SELECT ID_SOCIETATE FROM UTILIZATORI_SOCIETATI_ADMINISTRATE WHERE ID_UTILIZATOR=', _AUTHENTICATED_USER_ID, ')) OR
                (DOSARE.ID_SOCIETATE_RCA IN (SELECT ID_SOCIETATE FROM UTILIZATORI_SOCIETATI WHERE ID_UTILIZATOR=', _AUTHENTICATED_USER_ID, ') AND DOSARE.ID_SOCIETATE_CASCO IN (SELECT ID_SOCIETATE FROM UTILIZATORI_SOCIETATI_ADMINISTRATE WHERE ID_UTILIZATOR=', _AUTHENTICATED_USER_ID, ')) )) )');

        IF _ORDER IS NULL AND _SORT IS NULL THEN
                 SET _SORT = ' DOSARE.DATA_AVIZARE DESC ';
        END IF;

        SET @_QUERY = 'SELECT DOSARE.* ';

            SET @_QUERY = CONCAT(@_QUERY,
                'FROM DOSARE '
                );

        CASE WHEN _FILTER IS NOT NULL THEN
                SET @_QUERY = CONCAT(@_QUERY, ' WHERE (', @_DEFAULT_FILTER, ') AND (', _FILTER, ') ');
        ELSE
                SET @_QUERY = CONCAT(@_QUERY, ' WHERE (', @_DEFAULT_FILTER, ') ');
        END CASE;

        CASE WHEN _SORT IS NOT NULL THEN
                SET @_QUERY = CONCAT(@_QUERY, ' ORDER BY ', _SORT);
        ELSE
                SET @_QUERY = @_QUERY;
        END CASE;

        CASE WHEN _ORDER IS NOT NULL THEN
                SET @_QUERY = CONCAT(@_QUERY, ' ', _ORDER);
        ELSE
                SET @_QUERY = @_QUERY; 
        END CASE;

        IF _LIMIT IS NOT NULL THEN
                SET @_QUERY = CONCAT(@_QUERY, _LIMIT, ';');
        END IF;

        -- select @_QUERY;

          PREPARE stmt1 FROM @_QUERY;
          EXECUTE stmt1;
          DEALLOCATE PREPARE stmt1;
         
END $$
