DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `DOSARE_PLATIsp_IsImported`(
        _AUTHENTICATED_USER_ID INT,
        _NR_AZT VARCHAR(250),
        _AUTO_AZT VARCHAR(250),
        _POLITA_AZT VARCHAR(250)
    )
BEGIN
        DECLARE _VAL VARCHAR(250);
        SET _VAL = (SELECT NR_AZT FROM DOSARE WHERE NR_AZT = _NR_AZT);
        IF _VAL IS NULL THEN
                BEGIN
                SET _VAL = (SELECT NR_AZT FROM DOSARE WHERE POLITA_AZT = _POLITA_AZT);
                IF _VAL IS NULL THEN
                        SET _VAL = (SELECT NR_AZT FROM DOSARE WHERE AUTO_AZT = _AUTO_AZT);
                END IF;
                END;
        END IF;
        SELECT _VAL;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

