        BLOCK2: BEGIN
        DECLARE cursorStadii CURSOR FOR SELECT * FROM `sca`.`regrese_stadii` rs inner join `sca`.`stadii` s on rs.id_stadiu = s.id where rs.id_regres = _ID_DOSAR;
