                CALL DOSARE_STADIIsp_insert(@_ID_DOSAR_NOU, @_ID_STADIU_NOU, _DATA, _SCADENTA, _TERMEN, _TERMEN_ADMINISTRATIV, _OBSERVATII_STADII, _ORA, null, null, null, null, @_ID_DOSAR_STADIU_NOU);
