                CALL SENTINTEsp_insert(_NR_SENTINTA, _DATA_SENTINTA, _DATA_COMUNICARE, @_ID_SOLUTIE_NOU, @_ID_SENTINTA_NOU);
                IF @_ID_DOSAR_STADIU_NOU IS NOT NULL AND @_ID_SENTINTA_NOU IS NOT NULL THEN
