--
-- Definition of procedure `MESAJEsp_select`
--

DROP PROCEDURE IF EXISTS `MESAJEsp_select`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `MESAJEsp_select`(
        _AUTHENTICATED_USER_ID INT,
        _SORT VARCHAR(100),
        _ORDER VARCHAR(5),
        _FILTER VARCHAR(4000),
        _LIMIT VARCHAR(100)
    )
BEGIN
        DECLARE _DEFAULT_FILTER VARCHAR(2000);

        DECLARE _QUERY VARCHAR(8000);
        /*
        SET @_DEFAULT_FILTER = CONCAT('(', _AUTHENTICATED_USER_ID, ' IN (SELECT ID FROM UTILIZATORI WHERE ID_TIP_UTILIZATOR = (SELECT ID FROM TIP_UTILIZATORI WHERE UPPER(DENUMIRE)=''ADMINISTRATOR'')) OR ');
        SET @_DEFAULT_FILTER = CONCAT(@_DEFAULT_FILTER, '( ', _AUTHENTICATED_USER_ID, ' IN (SELECT ID FROM UTILIZATORI WHERE ID_TIP_UTILIZATOR = (SELECT ID FROM TIP_UTILIZATORI WHERE UPPER(DENUMIRE) LIKE ''%SUPER%''))
                AND (U.ID IN (SELECT ID_UTILIZATOR FROM UTILIZATORI_SOCIETATI WHERE ID_SOCIETATE IN (SELECT ID_SOCIETATE FROM UTILIZATORI_SOCIETATI WHERE ID_UTILIZATOR=', _AUTHENTICATED_USER_ID,') AND U.ID_TIP_UTILIZATOR = (SELECT ID FROM TIP_UTILIZATORI WHERE UPPER(DENUMIRE) LIKE ''%REGULAR%'') )) ))');
        */
        SET @_DEFAULT_FILTER = '1=1';

        IF _ORDER IS NULL AND _SORT IS NULL THEN
                 SET _SORT = ' MESAJE.DATA ';
        END IF;

        SET @_QUERY = 'SELECT MESAJE.* ';

            SET @_QUERY = CONCAT(@_QUERY,
                'FROM MESAJE '
                );

        CASE WHEN _FILTER IS NOT NULL THEN
                SET @_QUERY = CONCAT(@_QUERY, ' WHERE (', @_DEFAULT_FILTER, ') AND (', _FILTER, ') ');
        ELSE
                BEGIN
                 SET @_QUERY = CONCAT(@_QUERY, ' WHERE ', @_DEFAULT_FILTER, ' ');
                END;
        END CASE;

        CASE WHEN _SORT IS NOT NULL THEN
                BEGIN
                        SET @_QUERY = CONCAT(@_QUERY, ' ORDER BY ', _SORT);
                END;
        ELSE
                SET @_QUERY = @_QUERY;
        END CASE;

        CASE WHEN _ORDER IS NOT NULL THEN
                SET @_QUERY = CONCAT(@_QUERY, ' ', _ORDER);
        ELSE
                SET @_QUERY = CONCAT(@_QUERY, ' DESC');
        END CASE;

        IF _LIMIT IS NOT NULL THEN
                SET @_QUERY = CONCAT(@_QUERY, _LIMIT, ';');
        END IF;

        -- select @_QUERY;

          PREPARE stmt1 FROM @_QUERY;
          EXECUTE stmt1;
          DEALLOCATE PREPARE stmt1;
          


END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `MESAJEsp_SelectByParams`
--

DROP PROCEDURE IF EXISTS `MESAJEsp_SelectByParams`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `MESAJEsp_SelectByParams`(
	_ID_SENDER INT,
	-- _ID_RECEIVER INT,
	_SUBIECT VARCHAR(250),
	_BODY TEXT,
	_DATA DATETIME,
	_ID_DOSAR INT,
	_IMPORTANTA BOOL,
	_ID_TIP_MESAJ INT,
	_DATA_CITIRE DATETIME,
        _PAGE INT,
        _RECORDS_PER_PAGE INT,
        _SEARCH_STRING VARCHAR(250)
)
BEGIN
	SELECT M.*, U1.USER_NAME `FROM`, U2.USER_NAME `TO`,
	-- D.NR_DOSAR, TD.DENUMIRE `TIP_DOSAR`
	'' NR_DOSAR, '' TIP_DOSAR
	FROM MESAJE M
	INNER JOIN UTILIZATORI U1 ON M.ID_SENDER=U1.ID 
	-- INNER JOIN UTILIZATORI U2 ON M.ID_RECEIVER=U2.ID
	-- INNER JOIN DOSARE D ON M.ID_DOSAR=D.ID
	-- INNER JOIN TIP_DOSARE TD ON M.ID_TIP_DOSAR=TD.ID
	WHERE
		(ID_SENDER = _ID_SENDER OR _ID_SENDER IS NULL) AND
		-- (ID_RECEIVER = _ID_RECEIVER OR _ID_RECEIVER IS NULL) AND
		(SUBIECT = _SUBIECT OR _SUBIECT IS NULL) AND
		(BODY = _BODY OR _BODY IS NULL) AND
		(DATA = _DATA OR _DATA IS NULL) AND
		(ID_DOSAR = _ID_DOSAR OR _ID_DOSAR IS NULL) AND
		(IMPORTANTA = _IMPORTANTA OR _IMPORTANTA IS NULL) AND 
		(ID_TIP_MESAJ = _ID_TIP_MESAJ OR _ID_TIP_MESAJ IS NULL) AND
		(DATA_CITIRE = _DATA_CITIRE OR _DATA_CITIRE IS NULL)
	ORDER BY DATA DESC;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

