        SELECT
        -1	  ID,
        null	NR_INTERN,
        null	NR_DOSAR_INSTANTA,
        null	DATA_DEPUNERE,
        null	OBSERVATII,
        null	ID_TIP_DOSAR,
        null	SUMA_SOLICITATA,
        null	PENALITATI,
        null	TAXA_TIMBRU,
        null	TIMBRU_JUDICIAR,
        null	ONORARIU_EXPERT,
        null	ONORARIU_AVOCAT,
        null	ID_INSTANTA,
        null	ID_COMPLET,
        null	ID_CONTRACT,
        null	STADIU,
        null	ZILE_PENALIZARI;
        

        SELECT
        -1	  ID,
        null	NR_DOCUMENT,
        null	DATA_DOCUMENT,
        null	SUMA,
        null	OBSERVATII;
        

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

