DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `UTILIZATORI_DREPTURIsp_GetAllByIdUtilizator`(
        _AUTHENTICATED_USER_ID INT,
        _ID_UTILIZATOR INT
    )
BEGIN
        SELECT D.ID, D.DENUMIRE, IF(UD.ID_UTILIZATOR IS NULL, FALSE, TRUE) ASIGNAT FROM DREPTURI D
        LEFT JOIN (SELECT ID_UTILIZATOR, ID_DREPT FROM UTILIZATORI_DREPTURI WHERE ID_UTILIZATOR = _ID_UTILIZATOR) UD ON D.ID = UD.ID_DREPT
        ORDER BY D.DENUMIRE ASC;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

